type: object, description: A configuration object describing the navigation target. The navigation target can be provided as its separate aspects like semantic object, action, parameters etc. in separate members of the configuration object.

<b>Note:</b> Parameter values can contain special characters and must be provided unencoded; the function takes care for necessary encodings itself.

Simple Example: <pre>
{
  target: {
    semanticObject: "Customer",
    action: "display"
  },
  params: {
    customerId: "0815-4711"
  }
}
</pre>

Example with text: <pre>
{
  target: {
    semanticObject: "Note",
    action: "create"
  },
  params: {
    noteText: "Thanks for reading the documentation!"
  }
}
</pre>

Example with a given context: <pre>
{
  target: {
    semanticObject: "AnObject",
    action: "action",
    context: "AB7F3C"
  },
  params: {
    param1: "Value One"
  }
}
</pre>

Alternatively a <code>shellHash</code> can be provided that includes already all aspects of the navigation target: semantic object, action, intent parameters, app-specific route (including app parameters)

<b>Note:</b> While parameters need to be url-encoded once when used in the <code>shellHash</code> the app specific route must not be encoded.

Example with shellHash as target: <pre>
{
  target: {
    shellHash: "Note-update?noteText=You%20got%20quite%20far&/Notes/My First Note"
  }
}
</pre>

To navigate to the homepage of the Fiori launchpad, navigate to <code>{target: {shellHash: "#"}}</code>. Do not use "#Shell-home" or "Shell-home" to navigate to!

To provide a complex parameter structure to a target app the pseudo parameter <code>sap-xapp-state-data</code> can be used.

Example: <pre>
{
  ...
  params : {
    "sap-xapp-state-data": JSON.stringify({ a: "b", c: "d" })
  }
}
</pre>

The data specified via <code>sap-xapp-state-data</code> is passed to the target application in the <code>sap-xapp-state</code> parameter. The <code>sap-xapp-state-data</code> parameter itself is not passed to the target application.

<b>Note:</b> The parameter length (including semantic object and action) shall not exceed 512 bytes when serialized as UTF-8.

