showHeaderItem.!description:
Creates and displays one or more HeaderItem controls according to the given control IDs and Shell states<br> (see sap.ushell.renderers.fiori2.Renderer.LaunchpadState).<br><br> The HeaderItem controls will be displayed on the left side of the Fiori Launchpad shell header according to the given display parameters.<br> There can be up to three header items. If the number of existing header items plus the given ones exceeds 3, then the operation fails and no new header items are created.<br>

<b>Example:</b> <pre>
var button1 = new sap.ushell.ui.shell.ShellHeadItem();
var button2 = new sap.ushell.ui.shell.ShellHeadItem();
var renderer = sap.ushell.Container.getRenderer("fiori2");
renderer.showHeaderItem ([button1.getId(), button2.getId()], false, ["home", "app"]);
</pre>

showHeaderEndItem.!description:
Displays HeaderItems on the right side of the Fiori launchpad shell header, in the given launchpad states (see sap.ushell.renderers.fiori2.Renderer.LaunchpadState).</br> If no launchpad state is provided the content is displayed in all states.</br> The shell header can display the user HeaderItem, and just one more HeaderItem.</br> If this method is called when the right side of the header is full, this method will not do anything.</br>

<b>Example:</b> <pre>
var button1 = new sap.ushell.ui.shell.ShellHeadItem();
var renderer = sap.ushell.Container.getRenderer("fiori2");
renderer.showHeaderEndItem ([button1.getId()], false, ["home", "app"]);
</pre>

addHeaderItem.!description:
Creates and displays an item in the header of Fiori launchpad, in the given launchpad states.<br> The new header item will be displayed on the left-hand side of the Fiori Launchpad shell header, according to the given display parameters.<br> The new header item will be added to the right of any existing header items. The header can contain a maximum of three header items.<br><br>

<b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2");
    oRenderer.addHeaderItem({
        id: "myTestButton",
        ariaLabel: resources.i18n.getText("testButton.label"),
        ariaHaspopup: "dialog",
        icon: "sap-icon://action-settings",
        tooltip: resources.i18n.getText("testButton.tooltip"),
        text: resources.i18n.getText("testButton.text"),
        press: controller.handleTestButtonPress
    }, true, true);
</pre>

addSidePaneContent.!description:
Creates the Left Pane content in Fiori launchpad, in the given launchpad states.</br>

<b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
    oSidePaneContentProperties = {
        controlType : "sap.m.Button",
        oControlProperties : {
            id: "testBtn",
            text: "Test Button"
        },
        bIsVisible: true,
        bCurrentState: true
    };

oRenderer.addSidePaneContent(oSidePaneContentProperties);
</pre>

addShellSubHeader.!description:
Creates and displays a sub header control in Fiori launchpad, in the given launchpad states.<br> The new control is displayed in FLP UI according to the given display parameters.<br> If a sub header already exists, the new created one will replace the existing one.<br><br> <b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
    oAddSubHeaderProperties = {
        controlType : "sap.m.Bar",
        oControlProperties : {
            id: "testBar",
            contentLeft: [new sap.m.Button({
                text: "Test SubHeader Button",
                press: function () {
                    sap.m.MessageToast.show("Pressed");
                }
            })
        },
        bIsVisible: true,
        bCurrentState: true
    };

oRenderer.addShellSubHeader(oAddSubHeaderProperties);
</pre>

addUserAction.!description:
Creates an Action Button in Fiori launchpad, in the given launchpad states. </br> The button will be displayed in the user actions menu, that is opened from the user button in the shell header.</br> <b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2"),
    oAddActionButtonProperties = {
        controlType : "sap.m.Button",
        oControlProperties : {
            id: "exampleButton",
            text: "Example Button",
            icon: "sap-icon://refresh",
            press: function () {
                alert("Example Button was pressed!");
            }
        },
        bIsVisible: true,
        bCurrentState: true
    };
oRenderer.addUserAction(oAddActionButtonProperties);
</pre>

setShellFooter.!description:
Creates and displays an SAPUI5 control as the footer of the Fiori launchpad shell.<br> The footer will be displayed in all states. <br> Previously created footer will be removed. <br>

