oRenderer.setShellFooter(oFooterControlProperties);
</pre>

showSubHeader.!description:
Displays one or more sub header controls according to the given control IDs and shell states.<br> (see sap.ushell.renderers.fiori2.Renderer.LaunchpadState).<br><br> A sub header is placed in a container, located directly below the main Fiori launchpad shell header.<br>

<b>Example:</b> <pre>
var bar = new sap.m.Bar({id: "testBar", contentLeft: [new sap.m.Button({text: "Test SubHeader Button",
  press: function () {
    sap.m.MessageToast.show("Pressed");
  }})
]});
var oRenderer = sap.ushell.Container.getRenderer("fiori2");
oRenderer.showSubHeader([bar.getId()], false, ["home", "app"]);
</pre>

addToolAreaItem.!description:
Creates a ToolAreaItem in Fiori Launchpad and adds it to the Tool Area, in the given launchpad states. Once the item is added, the Tool Area is rendered on the left side on the Fiori Launchpad shell.

<b>Example:</b> <pre>
sap.ushell.Container.getRenderer("fiori2").addToolAreaItem({
  id: "testButton",
  icon: "sap-icon://documents",
  expandable: true,
  press: function (evt) {
    window.alert("Press" );
  },
  expand: function (evt) {
    // This function will be called on the press event of the "expand" button. The result of "expand" event in the UI must be determined by the developer
    window.alert("Expand" );
  }
}, true, false, ["home"]);
</pre>

showActionButton.!description:
Displays action buttons in the User Actions Menu in the SAP Fiori launchpad, in the given launchpad states (LaunchpadState). (see sap.ushell.renderers.fiori2.Renderer.LaunchpadState).</br> If no launchpad state is provided the content is displayed in all states.</br> The user actions menu is opened via the button on the right hand side of the shell header.</br>

<b>Example:</b> <pre>
var button1 = new sap.m.Button();
var renderer = sap.ushell.Container.getRenderer("fiori2");
renderer.showActionButton([button1.getId()], false, ["home", "app"]);
</pre>

addUserPreferencesEntry.!description:
Adds an entry to the User Preferences dialog box including the UI control that appears when the user clicks the new entry, and handling of User Preferences actions such as SAVE and CANCEL.

<b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2");
var oEntry = {
  title: "title",
  value: function() {
      return jQuery.Deferred().resolve("entryTitleToBeDisplayed");
  },
  content: function() {
      return jQuery.Deferred().resolve(new sap.m.Button("userPrefEntryButton", {text: "Button"}));
  },
  onSave: function() {
      return jQuery.Deferred().resolve();
  }
};
oRenderer.addUserPreferencesEntry(oEntry);
</pre>

addHeaderEndItem.!description:
Creates and displays a shell header icon in Fiori launchpad, in the given launchpad states.</br> The icon is displayed in the right side of the Fiori Launchpad shell header or in an overflow menu.</br> The text property is mandatory as it might be used in the overflow menu.</br> The tooltip property must not have the same text as the text property, as this causes accessibility issues if the item is in the overflow menu.</br> If no tooltip is provided, the text property is shown as tooltip when the item is not in the overflow menu.</br>

<b>Example:</b> <pre>
var oRenderer = sap.ushell.Container.getRenderer("fiori2");

    // Create an icon button that opens a dialog
    oRenderer.addHeaderEndItem({
        id: "myTestButton",
        icon: "sap-icon://action-settings",
        tooltip: resources.i18n.getText("testButton.tooltip"),
        text: resources.i18n.getText("testButton.text"),
        ariaLabel: resources.i18n.getText("testButton.ariaLabel"),
        ariaHaspopup: "dialog",
        press: [myController.handleTestButtonPress, myController]
    }, true);

    // Create a temporary link
    oRenderer.addHeaderEndItem({
        id: "myTestLink",
        ariaLabel: resources.i18n.getText("testLink.label"),
        target: "#MyTestApplication-show",
        icon: "sap-icon://overflow"
    }, true, true);
</pre>

