sap.ushell.services.URLParsing.!description:
The Unified Shell's internal URL parsing service (platform independent).

<b>Note:</b> To retrieve a valid instance of this service, it is necessary to call {@link sap.ushell.Container#getServiceAsync}. <pre>
  sap.ui.require(["sap/ushell/Container"], async function (Container) {
    const URLParsing = await Container.getServiceAsync("URLParsing");
    // do something with the URLParsing service
  });
</pre>

Methods in this class allow to break down a shell compliant hash into it's respective parts (SemanticObject,Action,Context, Parameters, appSpecificHash) or (ShellPart,appSpecificHash) respectively or construct a hash from its constituents.

All methods deal with the *internal* shellHash format.

Most of the parse methods are robust w.r.t. a leading "#".

Note: The functions were designed with a "truthy" behavior for not present values, Thus a client should not rely on the difference between null, "undefined", "" when testing for the result of a parse action.

The parsing functions are deliberately restrictive and fragile, only shell compliant hashes are parsed correctly, behavior for non-compliant hashes is undefined and subject to change, notably we do not aim do "degrade" nicely or support partial parsing of corrupted urls.

