getServiceAsync.!description:
Returns a Promise that resolves a service with the given name, creating it if necessary. Services are singleton objects identified by their (resulting) name.

Names without a dot are interpreted as service names within the default naming convention and will be expanded to <code>"sap.ushell.services." + sServiceName</code>. Names containing a dot are not yet supported. This name may be overridden via configuration. See example 2 below.

The resulting name must point to a constructor function which is first required as a SAPUI5 module and then called to create a service instance. The service will be passed to a corresponding service adapter for the current logon system, as well as a callback interface (of virtual type <code>sap.ushell.services.ContainerInterface</code>) to the container providing a method <code>createAdapter(oSystem)</code> to create further adapters for the same service but connected to remote systems. The third parameter will be <code>sParameter</code> as passed to this function. The fourth parameter will be an object with the property <code>config</code> supplied by the configuration. See example 2 below.

The adapter for the logon system will be created before the service. Its constructor gets three parameters. The first parameter is the logon system, the second parameter is <code>sParameter</code> and the third parameter is an object with the property <code>config</code> supplied by the configuration.

The service may declare itself adapterless by setting the property <code>hasNoAdapter = true</code> at the constructor function. In this case no adapter will be created and passed to the constructor and all other parameters will be shifted.

<b>Example 1:</b> The service <code>sap.ushell.services.UserInfo</code> is parameterless. It indicates this by setting <code>sap.ushell.services.UserInfo.hasNoAdapter = true;</code>.

<b>Example 2:</b> (Configuration) <pre>
  window["sap-ushell-config"] = {
    services: {
      Foo: {
        module: "my.own.Foo"
        config: {header: "hidden"},
        adapter: {
          module: "my.own.FooAdapter",
          config: {foo: "bar"}
        }
      }
    }
  }
  sap.ushell.Container.getServiceAsync("Foo", "runtimeConfig")
      .then(function (Foo) {
          // Do something with the service
      });
  </pre> Now the parameter provided in the promise handler is an instance of <code>my.own.Foo</code>. The third parameter of the constructor will be "runtimeConfig", the fourth parameter <code>{config: {header: "hidden"}}</code>. Its adapter is an instance of <code>my.own.FooAdapter</code> constructed with the parameters logon system, "runtimeConfig" and <code>{config: {foo: "bar"}}</code>.

