Allows to attach to any value change of the sizeBehavior configuration for homepage parts (smaller tile size) which is needed to implement custom tiles reacting on this setting. The returned value can directly be used in {@link sap.m.GenericTile#sizeBehavior}.

Once attached, <code>fnCallback</code> will be called once initially for the <b>current value</b> and afterwards every time the value changed.

