sap.ushell.ui5service.ShellUIService.!description:
The ShellUIService for the unified shell can be used to modify the app title or the app hierarchy.

<h3>Usage</h3>

Allows apps to interact with the SAP Fiori launchpad UI. A defined service is injected in the app components by the FLP before the corresponding apps start. To consume the service, app components should declare it in their "manifest.json" as follows:

<pre>
{
   ...
   "sap.ui5": {
      "services" : {
         "ShellUIService": {
             "factoryName": "sap.ushell.ui5service.ShellUIService"
         }
      }
   }
   ...
}
</pre>

The service can then be retrieved and consumed by the app component as in the following example:

<pre>
// Component.js (the app component)
...
this.getService("ShellUIService") // promise is returned
    .then(function (oService) {
        oService.setTitle("Application Title");
    })
    .catch(function (oError) {
        Log.error("Cannot get ShellUIService", oError, "my.app.Component");
    });
...
</pre>

The ShellUIService can also be used within nested components. Every component receives a separate instance of the service. All service instances are independent and do not share any state. With this they can also overwrite each other's settings. Nested components have to define the service in their own manifest as well.

<strong>Note:</strong> The ShellUIService is intended for use by the active app only. Calls from other types of components (e.g. plugins) or inactive components (e.g. from a hidden app) are ignored.

<h3>Auto Title and Hierarchy</h3>

The ShellUIService can work together with the routing defined in a UI5 app to set title and hierarchy automatically, as the navigation within the app occurs. This can be achieved by enabling the ShellUIService to load instantly and configuring one or both <code>setTitle</code> and <code>setHierarchy</code> options to <code>auto</code> in the app manifest. Using this mechanism disables the API to manually set the title or hierarchy via <code>setTitle</code> and <code>setHierarchy</code>.

<pre>
{
   "sap.ui5": {
      "services" : {
         "ShellUIService": {
             "lazy": false,
             "factoryName": "sap.ushell.ui5service.ShellUIService",
             "settings": {
                 "setHierarchy": "auto",
                 "setTitle": "auto"
             }
         }
      }
   }
}
</pre>

<strong>Note:</strong> Please be aware that the sapFiori2Adaptation configuration of the application may cause the ShellUIService service to work incorrectly. We recommend to disable the sapFiori2Adaptation configuration for the new applications if you use the ShellUIService.

setTitle.!description:
Displays the given title in the shell header. This method should not be called - and will be without effect - if the app calling the method is not currently displayed in the Fiori launchpad.

The sTitle will be concatenated with the window title extension and displayed as browser tab title. If oAdditionalInformation is set, the browser tab title will be constructed from the oAdditionalInformation plus window title extension. sTitle is still used in the shell header.

Examples: <pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title");
  // Shell Header title: "My App Title"
  // Browser Window Title: "My App Title - Fiori Launchpad"
</pre>

<pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title", {
    headerText: "My Header Text",
    additionalContext: "My Additional Context",
    searchTerm: "My Search Term",
    searchScope: "My Search Scope"
  });
  // Search Term has precedence over headerText and additionalContext.
  // Shell Header title: "My App Title"
  // Browser Window Title: "My Search Term in My Search Scope - Search - Fiori Launchpad"
</pre>

<pre>
  // Window Title Extension is: "Fiori Launchpad"

  setTitle("My App Title", {
    headerText: "My Header Text",
    additionalContext: "My Additional Context"
  });
  // Shell Header title: "My App Title"
  // Browser Window Title: "My Header Text - My Additional Context - Fiori Launchpad"
</pre>

