Note that the application parameter length (including SemanticObject/Action) shall not exceed 512 bytes when serialized as UTF-8.

Note that when receiving the values as startup parameters (as part of the component data object) single values are represented as an array of size 1. Above example is returned as <code> deepEqual(getComponentData().startupParameters , { "ProductID" : [ "102343333" ] } ) </code>

Make sure not to store sensitive data within an URL. URLs may appear in a server log, be persisted inside and outside the system.

Note: When constructing large URLs, the URLs may be shortened and persisted on a database server for prolonged time, the actual data is persisted under a key accessible to any User (guessing the key).

The same restrictions apply for the Application state.

navigate.!description:
Triggers a navigation to a specified target outside of the currently running application (e.g. different launchpad application). Invocation will trigger a hash change and subsequent invocation of the target.

If the navigation target opens in a new window the running application may be retained.

This API accepts a sap-xapp-state-data parameter that can be used generate a url that can be used to launch an app with certain data, for example: <pre>
  {
    target : { semanticObject : "AnObject", action: "action" },
    params : { "sap-xapp-state-data" : JSON.stringify({ a: "b", c: "d" }) }
  }
</pre> Using the arguments as in the example above, a link with a sap-xapp-state parameter that encodes the provided data is returned. The sap-xapp-state-data parameter does not appear in the generated link.

Do <b>not</b> use "#Shell-home" to navigate to a specific homepage!<br> A proper way for an application to generate a link to return to the home page of the Fiori launchpad is:<br> <code>navigate( { target : { shellHash : "#" }})</code>

