isNavigationSupported.!description:
Calculates whether the given navigation targets are supported for the given parameters, form factor etc. . "Supported" means that a valid navigation target is configured for the user and for the given device.

<code>isNavigationSupported</code> is a test function for {@link sap.ushell.services.Navigation#navigate} and {@link sap.ushell.services.Navigation#getHref}.

Example usage: <pre>
  const aResult = await oNavigationService.isNavigationSupported([{
    target: { shellHash: "SalesOrder-approve?SOId=1234" }
  }])
  if (aResult[0].supported===true){
      // enable link
    }
    else {
      // disable link
  }
